import * as React from "react";
import Box from "@mui/material/Box";

const style = {
    // position: "absolute",
    // top: "50%",
    // left: "50%",
    textAlign: "center",
    justifyContent: "center",
    // transform: "translate(-50%, -50%)",
    // width: "80%",
    // maxWidth: 500,
    width: "100%",
    // border: "2px solid white",
    // p: 4,
}

const NotFound = () => {
    return (
        <Box style={style}>
            <h1>Page Not Found</h1>
        </Box>
    )
}

export default NotFound;
